description:
Sucker Punch is a 2011 action-fantasy thriller film, about the fantasies of a young woman who is committed to a mental institution. It was written by Steve Shibuya and Zack Snyder and directed by Snyder. The film features an ensemble cast starring Emily Browning as the central character (Babydoll)and Abbie Cornish as the second main character (Sweet Pea), as well as Oscar Isaac (Blue).The film was released in both conventional and IMAX theatres in the US at midnight on March 25, 2011.A young girl is institutionalized by her wicked stepfather. Retreating to an alternative reality as a coping strategy, she envisions a plan which will help her escape from the facility. 
